import { Container } from 'react-bootstrap';
import './App.css';
import Footer from './components/footer';

function App() {
  return (
    <>
     <main>
     <Container>
        <h1>Ecommerce-app</h1>
      </Container>
     </main>
      <Footer></Footer>
    </>
  );
}

export default App;
